import React from "react";

function AboutPage() {
	return (
		<div>
			<h1>About This App</h1>
			<p className="my-1">
				The majority of cell phone users worldwide experience the issue of
				losing their contact lists due to either phone loss or phone damage,
				which is why Keeper is being created. NContact is a free personal
				information manager that allows you to save all of your friends',
				families', and colleges' contact information in a single database file.
				With the built-in birthday reminder, you'll never forget another
				birthday again! since you can now access them from any device with an
				internet connection.
			</p>
			<p className="bg-dark p">
				<strong>Version</strong> 1.0.9
			</p>
		</div>
	);
}

export default AboutPage;
